import React from 'react';

import { Facebook, Pinterest } from "react-social-sharing";

const styles = {
  background: "#543243"
};

const ShareSelect = () => {

    let shareUrl = 'www.copoecolher.com'

    return (
      <section className="share-select">
        <Facebook
          solid
          small
          style={styles}
          link="https://www.copoecolher.com"
        />
        <Pinterest
          solid
          small
          message="I use Copo e colher - Brazilian recipe converter!"
          link="https://www.copoecolher.com"
        />
      </section>
    );
};


export default ShareSelect;
